glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in vec4 a_color;
out vec4 v_color;
in vec2 a_uv0;
out vec2 v_uv0;
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  v_uv0 = a_uv0;
  v_color = a_color;
  gl_Position = pos;
}

glsl3.frag:
precision highp float;
vec4 CCFragOutput (vec4 color) {
  #if OUTPUT_TO_GAMMA
    color.rgb = sqrt(color.rgb);
  #endif
	return color;
}
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
in vec4 v_color;
in vec2 v_uv0;
uniform sampler2D texture;
uniform sampler2D gradientTexture;
#if USE_MASK
uniform sampler2D textureMask;
#endif
uniform shaderParams {
  vec4 dataTex_TexelSize;
  float alphaTreshold;
};
#if USE_BILINEAR_FILTER
  uniform bilinear {
    float bilinearOffset;
    float test;
  };
#endif
vec4 GetBilinearFilteredColor(sampler2D dataTex, sampler2D palette, vec2 texcoord)
{
  vec4 s1 = texture(dataTex,texcoord + vec2(0.0, dataTex_TexelSize.y));
  vec4 s2 = texture(dataTex,texcoord + vec2(dataTex_TexelSize.x, 0.0));
  vec4 s3 = texture(dataTex,texcoord + vec2(dataTex_TexelSize.x, dataTex_TexelSize.y));
  vec4 s4 = texture(dataTex,texcoord);
  vec4 p1 = texture(palette, 0.0 + vec2(s1.r , 0.5));
  vec4 p2 = texture(palette, 0.0 + vec2(s2.r , 0.5));
  vec4 p3 = texture(palette, 0.0 + vec2(s3.r , 0.5));
  vec4 p4 = texture(palette, 0.0 + vec2(s4.r , 0.5));
  p1.a *= s1.a;
  p2.a *= s2.a;
  p3.a *= s3.a;
  p4.a *= s4.a;
  vec2 TexturePosition = vec2(texcoord) * dataTex_TexelSize.zw;
  float fu = fract(TexturePosition.x);
  float fv = fract(TexturePosition.y);
  vec4 tmp1 = mix(p4, p2, fu);
  vec4 tmp2 = mix(p1, p3, fu);
  return mix(tmp1, tmp2, fv);
}
vec4 r_channel () {
  #if USE_BILINEAR_FILTER
    vec4 patterns = texture(texture, v_uv0);
    vec4 color = GetBilinearFilteredColor(texture, gradientTexture, v_uv0 - bilinearOffset * dataTex_TexelSize.xy);
    color.rgb = mix(color.rgb, color.rgb * color.a, color.a * alphaTreshold);
  #else
    vec4 patterns = texture(texture, v_uv0);
    vec2 uv = 0.0 + vec2(patterns.r , 0.5);
    vec4 color = texture(gradientTexture, uv);
    color.a = patterns.a * alphaTreshold;
  #endif
  #if USE_MASK
    vec4 mask = texture(textureMask, v_uv0);
    color = mix(patterns, color, mask.g);
  #endif
  color *= v_color;
  return CCFragOutput(color);
}
out vec4 cc_FragColor;
void main() { cc_FragColor = r_channel(); }

